[workspace]
exclude = ["util/test-gen"]
members = ["crates/*"]

resolver = "2"

[workspace.package]
authors    = ["tamasfe"]
edition    = "2021"
license    = "MIT"
homepage   = "https://taplo.tamasfe.dev"
repository = "https://github.com/tamasfe/taplo"

[workspace.dependencies]
ahash              = { version = "0.8.3" }
anyhow             = { version = "1.0.53" }
arc-swap           = { version = "1.5.0" }
async-trait        = { version = "0.1.52" }
clap               = { version = "4.4.18", default-features = false, features = ["std"] }
either             = { version = "1.6.1" }
futures            = { version = "0.3.5" }
getrandom          = { version = "0.2", default-features = false }
glob               = { version = "0.3" }
globset            = { version = "0.4.8" }
hex                = { version = "0.4" }
indexmap           = { version = "2.2" }
itertools          = { version = "0.10.3" }
lsp-types          = { version = "0.93.0" }
once_cell          = { version = "1.4" }
parking_lot        = { version = "0.12.0" }
regex              = { version = "1.5" }
reqwest            = { version = "0.11.9", default-features = false }
rowan              = { version = "0.15.3" }
schemars           = { version = "0.8.3" }
serde              = { version = "1" }
serde_json         = { version = "1.0.78" }
sha1               = { version = "0.10.5" }
tap                = { version = "1.0.1" }
thiserror          = { version = "1.0.30" }
time               = { version = "0.3.7" }
tokio              = { version = "1.24.2", default-features = false }
toml               = { version = "0.7" }
tracing            = { version = "0.1.30" }
tracing-subscriber = { version = "0.3.7" }
url                = { version = "2.2.2" }

[profile.release]
codegen-units = 1
lto           = "thin"
opt-level     = 3
strip         = true


[profile.bench]
lto       = true
opt-level = 3

variable "RUST_VERSION" {
  default = "1"
}

variable "XX_VERSION" {
  default = "master"
}

variable "RELEASE_TAG" {
  default = null
}

variable "REPO" {
  default = "tamasfe/taplo"
}

variable "PUSH" {
  default = false
}

variable "APK_FAMILY_PACKAGES" {
  default = [
    "make",
    "clang",
    "git",
    "lld",
    "build-base",
    "openssl-dev",
    "openssl-libs-static",
  ]
}


variable "platforms" {
  default = [
    "linux/i386",
    "linux/amd64",
    "linux/arm64",
    // "linux/riscv64",
    // "linux/s390x",
    "linux/arm/v7",
    // "linux/arm/v6",
  ]
}

target "_platforms" {
  platforms = platforms
}

group "default" {
  targets = ["binary", "oci"]
}

target "binary" {
  inherits = ["alpine"]
  output   = ["type=local,dest=target/alpine"]
  target   = "binary"
}

target "oci" {
  inherits = ["alpine"]
  output   = ["type=image,push=${PUSH}"]
  target   = "oci"
  tags     = flatten(["${REPO}:latest", RELEASE_TAG != null ? ["${REPO}:${RELEASE_TAG}"] : []])
}

target "alpine" {
  context    = "."
  platforms  = platforms
  pull       = true
  dockerfile = "docker/alpine/Dockerfile"
  args = {
    RUST_VERSION          = RUST_VERSION
    XX_VERSION            = XX_VERSION
    DISTRIBUTION_VERSION  = "3.20"
    DISTRIBUTION_PACKAGES = join(" ", APK_FAMILY_PACKAGES)
  }
}
